import React from 'react';

const Radio = (props)=>{
    return(
        <>
            <label htmlFor={props.name}>{props.labelName}</label>
            <input type="radio" 
                   className="form-control"
                   name={props.name}
                   onChange={props.handleChange} 
                   value={props.value}></input>
        </>
    )
}

export default Radio;
